import React, { Component } from 'react'
import '../style/Header.css'

export default class Header extends Component {
  render() {
    return (
      <header className='page-header'>

        <div className='container'>
          <h3>Caroline Nunes</h3>
        </div>

        <section className='nav'>
            <p className='about'><a href="/about">Sobre Mim</a></p>
            <p className='skills'><a href="/skills">_Skills</a></p>
            <p className='project'><a href="/">_Meus Projetos</a></p>
            <p className='contat'><a href="/contact">Contato</a></p>
        </section>
      </header>
    )
  }
}
